    </div>


    <div className="Map">
    {/* <!--Google map--> */}
<div  className='container'>
  <iframe width={"100%"} height={"500px"} src="https://www.google.com/maps/place/Cafe+pilkhwal/@28.6659572,77.0574446,17z/data=!3m1!4b1!4m6!3m5!1s0x390d044d85febc99:0xc969d3e65a0d1548!8m2!3d28.6659525!4d77.0600249!16s%2Fg%2F11hbkk8gq0?entry=ttu" frameborder="0"
    style={{border:"0"}} allowfullscreen></iframe>
</div>
{/* <!--Google Maps--> */}
    </div>
      
    </>
  )
}
